import React from 'react';
import {Link} from "react-router-dom";

class Feed extends React.Component{
	constructor(props){
		super(props);

		this.testData = ['data:image/png;base64,', 'data:image/png;base64,', 'data:image/png;base64,', 'data:image/png;base64,', 'data:image/png;base64,'];
	}

	render(){
		const posts = this.props.feedData.map((data, index) =>
			<Post images={data.images} linkedClasses={data.linkedClasses} />
		);
		return(
			<div className='feed white-c'>
				<Post images={this.testData} selectedIndex={this.selectedIndex}/>
				<Post />
			</div>
		);
	}
}

class Post extends React.Component{
	render(){
		let imageGal;
		if(this.props.images){
			imageGal = <ImageGallary images={this.props.images} selectedIndex={this.props.selectedIndex} />
		}

		return(
			<div className='post white-c'>
				<Link to='#'>
					<img className='profile-photo' src='data:image/png;base64,'/>
					<h1 className='white-c'>Sarah Steel</h1>
				</Link>
				<h5>Geometry, English, Philosophy</h5>
				<p>
					Lorem ipsum dolor sit amet, 
					consectetur adipisicing elit.
					Sed aliquam tempora recusandae
					blanditiis facilis vitae! Soluta, 
					odit neque iure, perspiciatis deserunt animi libero, 
					veniam consequatur et ab ipsam hic consequuntur!
				</p>
				{imageGal}

				<CommentSection />

			</div>
		);
	}
}

class CommentSection extends React.Component{
	constructor(props){
		super(props);

		this.state={
			showSubmit: false
		}
	}

	render(){
		return(
			<div className='comment-section'>
				<div className='row'>
					<div className='col-lg-1'>
						<button className='white-c'><i class="fas fa-heart"></i></button>
					</div>
					<div className='col-lg-11'>
						<p className='p-fake'><span className='textarea' role='textbox' contenteditable='true'></span></p>
					</div>
				</div>
			</div>
		);
	}
}

function ImageGallary(props){
	const smallImages = props.images.map((image, index) =>
		<div className='col-lg-6'>
			<img className='image' src={image}/>
		</div>
	);

	return(
		<div className='image-gal'>
			<div className='row'>
				{smallImages}
			</div>
		</div>
	);
}

export default Feed;
